import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className="w-64 h-full bg-gray-800 text-white">
      <ul>
        <li className="p-4 hover:bg-gray-600">
          <Link to="/table">Data Table</Link>
        </li>
        <li className="p-4 hover:bg-gray-600">
          <Link to="/charts">Charts</Link>
        </li>
      </ul>
    </div>
  );
};

export default Sidebar;
